import "./App.css";
import Stage from "./components/Stage/Stage";
import { Route, Routes, Outlet } from "react-router-dom";
import Project from "./components/Project/Project";
import NavBar from "./components/Project/NavBar";
import Header from "./components/Project/Header";
import { useEffect } from "react";
import YourReactComponent from "./Api/YourReactComponent";
import WebSocketComponent from "./Api/WebSocketService";

function App() {
  const socket = new WebSocket("ws://localhost:8080/ws");
socket.onopen = (event) => {
  console.log("WebSocket connection opened:", event);
};
socket.onerror = (event) => {
  console.error("error:", event);
}
socket.onmessage = (event) => {
  const notificationMessage = event.data;
  console.log("Received notification:", notificationMessage);
  // Handle the received notification message in your frontend UI
};
socket.onclose = (event) => {
  console.log("WebSocket connection closed:", event);
};
  return (
    <div className="App mainComponent">
      <Routes>
        <Route>
          <Route path="projects/:projectId" element={<Project />} />
          <Route path="stages" element={<Stage />} />
        </Route>
      </Routes>
      <Header />
      <NavBar />
    </div>
  );
}

export default App;
